import React from 'react';

function Blogs({ blogs, onDelete }) {
  return (
    <div className="blogs-list">
      {blogs.map((blog) => (
        <div key={blog.id} className="blog-preview">
          <h2>{blog.blogName}</h2>
          <button onClick={() => onDelete(blog.id)}>Удалить</button>
        </div>
      ))}
    </div>
  );
}

export default Blogs;
